import React, { Component } from "react";
import "./App.css";
import UploadPhoto from "./images/upload_file.png";

class App extends Component {
  state = {
    image: UploadPhoto
  };

  render() {
    return (
      <div className="main-container">
        <div className="header" id="item-1">
          <h1>Simple Inventory System</h1>
        </div>
        <div className="items-container">
          <div className="item-header">
            <div>#</div>
            <div>Product Name</div>
            <div>Quantity</div>
            <div>Measurement</div>
            <div>Original Price</div>
            <div>Profit</div>
            <div>Selling Price</div>
            <div>Supplier</div>
            <div>Delete</div>
            <div>Edit</div>
          </div>
          <div className="item">
            <div>1</div>
            <div>Pen</div>
            <div>35</div>
            <div>Piece</div>
            <div>$25</div>
            <div>$10</div>
            <div>$35</div>
            <div>Smart Suppliers</div>
            <div>Delete</div>
            <div>Edit</div>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
